import React, { Component } from 'react';
import Todos from './components/Todos'

class App extends Component  {

  state = {
     todos : [
       {
         id: 1,
         title: 'Learn react',
         completed: false
       }, 
       {
        id: 2,
        title: 'Learn spring',
        completed: true
      }, 
      {
        id: 3,
        title: 'Learn docker',
        completed: false
      }
     ]
  }

  markComplete = (id) => {
    console.log(id)
}


  render () {
    return (
      <div>
      <Todos todos= { this.state.todos } markComplete= {this.markComplete}/>
      </div>
    )

  };
}

export default App;
